function searchFilter(){
    $.ajax({
        type: 'POST',
        url: 'getData.php',
        data: 'keywords='+$('#searchInput').val()+'&filter='+$('#filterSelect').val(),
        beforeSend: function(){
            $('.loading-overlay').show();
        },
        success:function(html){
            $('.loading-overlay').hide();
            $('#userData').html(html);
        }
    });
}